@import url("https://fonts.googleapis.com/css?family=Indie+Flower|Permanent+Marker");
@import url("https://fonts.googleapis.com/css?family=Indie+Flower|Permanent+Marker");
@import url("https://fonts.googleapis.com/css?family=Indie+Flower|Permanent+Marker");
.background {
  background-color: #070716;
  height: 100vh;
  width: 100vw;
  position: fixed;
  top: 0;
  left: 0;
  z-index: -1;
}

canvas {
  height: 100%;
  width: 100%;
  background-color: #fff;
}

.App {
  text-align: center;
  color: #e28e2d;
  font-family: "Permanent Marker", cursive;
  font-size: calc(10px + 3vmin);
  display: grid;
  width: 90vw;
  height: 100vh;
  margin: auto;
  grid-template-rows: 1fr 8fr 1fr;
}

#muteDiv {
  position: absolute;
  top: 2vmax;
  left: 2vmax;
}

#muteBtn {
  user-select: none;
  border: 4px solid #e28e2d;
  border-radius: 10px;
  padding: 0.5vmin 1vmin;
  width: 13vw;
}

#muteBtn:hover {
  background: #191941;
  color: #ff8800;
}

#coin,
#spikes {
  display: none;
}
